    false,nt"url": null,nt"notes": "This narrative report for Great River National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1958. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, big game animals, furbearers, predators, rodents, raptors, and fish- is also
    covered. The Refuge development and maintenance section discusses physical developments
    and plantings. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, and hunting. Items of interest and
    N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
